import React, {useState} from "react";

function Customer(){
    const [username, setUsername] = useState('')
    const [password, setPassword] = useState('')
    const [name, setName] = useState('')
    const [phone, setPhone] = useState('')
    const [email, setEmail] = useState('')

    return (
        <form>
            Name: <input type="text"  value={this.state.name} onChange={(e)=>{setName(e.target.value)}}/>
            Phone: <input type="text" value={this.state.Phone} onChange={(e)=>{setPhone(e.target.value)}}/>
            Email: <input type="text" value={this.state.email} onChange={(e)=>{setEmail(e.target.value)}}/>
            Username: <input type="text" value={this.state.username} onChange={(e)=>{setUsername(e.target.value)}}/>
            Password: <input type="password" value={this.state.password} onChange={(e)=>{setPassword(e.target.value)}}/>
            <input type="submit" value="Register" />
        </form>
    )
}
export default Customer
